import React, { Component } from 'react';

class mySkills extends Component {
    constructor(props){
        super(props)
        this.state = {
            data: parseFloat(1).toFixed(2)
        }
    }

    updateData = (event) => {
        this.setState({
            data: parseFloat(event.target.value).toFixed(2)
        })
    }

    render(){
        return(
            <div>
                <h4>
                    {this.props.objects.description}
                    <select onChange={this.updateData}>
                        {Object.keys(this.props.objects.skill_level).map((key, index) => {
                            return(
                                <option value={this.props.objects.skill_level[key]}>{key}</option>
                            )
                        })}
                    </select>

                </h4>
            </div>
        )
    }
}

export default mySkills;
